import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import formList from '../Form';

const lista = () => {
    let array = [{
            id: 'a',
            firstname: 'Gina'
        },
        {
            id: 'b',
            firstname: 'Pina'
        },
        {
            id: 'c',
            firstname: 'Maria'
        },
    ];

    return <>
        <div>
            <Container className="App-space">
                <Row>
                    <Col xs={4}>
                        <ul>
                            {array.map((item) => (
                                <li key={item.id}>
                                    <span>{item.firstname}</span>
                                    <button style={{border: "none", background: "white"}} type="button" onClick={() => formList}>
                                    ❌
                                    </button>
                                </li>
                            ))}
                            </ul>
                    </Col>
                </Row>
            </Container>
        </div>

    </>
}
export default lista
